PS "Royal" - это подлинное французское качество. Качественные материалы, передовые технологии, богатая комплектация - все это гарант надежности и популярности электронных сигарет "Royal".

Приобретая PS "Royal", Вы получаете:

- 2 сигареты (аккумуляторы);
- зарядное устройство от сети 220В;
- 6 сменных картамайзеров;
- инструкция на русском и английском языке;
- на выбор в белом и черном исполнении;
